For-loops
Often you don’t want to iterate over a range, but over an object

for (element in c("Amsterdam","Rotterdam","Eindhoven")){
  print(element)
}

[1] "Amsterdam"
[1] "Rotterdam"
[1] "Eindhoven"



for (element in c("Amsterdam","Rotterdam","Eindhoven")){
  print(element)
  if (element == "Amsterdam"){
    print("Terrible football team.")
  } else {
    print("No comments.")
  }
}

[1] "Amsterdam"
[1] "Terrible football team."
[1] "Rotterdam"
[1] "No comments."
[1] "Eindhoven"
